import React, { useState, useEffect } from "react";
import {
  Box,
  Button,
  Container,
  Typography,
  Dialog,
  DialogTitle,
  DialogContent,
  DialogActions,
  TextField,
  MenuItem,
  Select,
  InputLabel,
  FormControl,
  Tabs,
  Tab,
  AppBar,
} from "@mui/material";
import API from "../api";
import TrackActivities from "./TrackActivities";

const AdminDashboard = () => {
  const [tabIndex, setTabIndex] = useState(0);
  const [courses, setCourses] = useState([]);
  const [files, setFiles] = useState([]); // For adding files to an existing course
  const [selectedCourse, setSelectedCourse] = useState("");
  const [openAddFileDialog, setOpenAddFileDialog] = useState(false);

  // Fetch data on load
  useEffect(() => {
    fetchCourses();
  }, []);

  // Fetch all courses
  const fetchCourses = async () => {
    try {
      const { data } = await API.get("/courses");
      setCourses(data);
    } catch (error) {
      alert("Error fetching courses");
    }
  };

  // Upload additional files to an existing course
  const handleAddFiles = async () => {
    try {
      if (!selectedCourse || files.length === 0) {
        alert("Please select a course and files to upload.");
        return;
      }

      const formData = new FormData();
      files.forEach((file) => formData.append("pdfFiles", file));

      await API.post(`/courses/${selectedCourse}/add-files`, formData, {
        headers: { "Content-Type": "multipart/form-data" },
      });

      alert("Files added to the course successfully!");
      fetchCourses();
      setFiles([]);
      setOpenAddFileDialog(false);
    } catch (error) {
      console.error("Error adding files to the course:", error);
      alert("Error adding files. Please try again.");
    }
  };

  // Handle tab change
  const handleTabChange = (event, newValue) => {
    setTabIndex(newValue);
  };

  return (
    <Container maxWidth="md" sx={{ mt: 8 }}>
      <Typography variant="h4" gutterBottom>
        Admin Dashboard
      </Typography>

      <AppBar position="static" color="default" sx={{ mt: 2 }}>
        <Tabs
          value={tabIndex}
          onChange={handleTabChange}
          indicatorColor="primary"
          textColor="primary"
          variant="fullWidth"
        >
          <Tab label="Manage Courses" />
          <Tab label="Track Activities" />
        </Tabs>
      </AppBar>

      {/* Manage Courses Tab */}
      {tabIndex === 0 && (
        <Box sx={{ mt: 4 }}>
          {/* Add Files to Existing Course */}
          <Typography variant="h6">Add Files to Existing Course</Typography>
          <Button
            variant="contained"
            color="primary"
            onClick={() => setOpenAddFileDialog(true)}
            sx={{ mb: 2 }}
          >
            Add Files to Course
          </Button>
          <Dialog open={openAddFileDialog} onClose={() => setOpenAddFileDialog(false)}>
            <DialogTitle>Add Files to Course</DialogTitle>
            <DialogContent>
              <FormControl fullWidth margin="normal">
                <InputLabel>Course</InputLabel>
                <Select
                  value={selectedCourse}
                  onChange={(e) => setSelectedCourse(e.target.value)}
                >
                  {courses.map((course) => (
                    <MenuItem key={course._id} value={course._id}>
                      {course.title}
                    </MenuItem>
                  ))}
                </Select>
              </FormControl>
              <input
                type="file"
                multiple
                accept=".pdf"
                onChange={(e) => setFiles(Array.from(e.target.files))}
                style={{ marginTop: "16px" }}
              />
            </DialogContent>
            <DialogActions>
              <Button onClick={() => setOpenAddFileDialog(false)} color="secondary">
                Cancel
              </Button>
              <Button onClick={handleAddFiles} color="primary">
                Add Files
              </Button>
            </DialogActions>
          </Dialog>
        </Box>
      )}

      {/* Track Activities Tab */}
      {tabIndex === 1 && (
        <Box sx={{ mt: 4 }}>
          <TrackActivities />
        </Box>
      )}
    </Container>
  );
};

export default AdminDashboard;
